import React from 'react'
import {Container,row,button, Row} from 'reactstrap';
import { NavLink,Link } from 'react-router-dom';

const nav_link=[
  {
     path:'/home',
     display:'Home'
  },

  {
    path:'/',
    display:'About'
 },

 {
  path:'/home',
  display:'Tours'
},

{
  path:'/home',
  display:'Home'
},
]

const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          <div className="nav-wrapper d-flex align-items-center justify-content-between"></div>
        </Row>
      </Container>
    </header>
  )
}

export default Header
